import React from "react";
import styles from "./button.module.css";

const button = (props) => {
  return (
    <button
      className={styles.btn}
      onClick={props.clicked}
      style={{ ...props.style }}
      {...props}
    >
      {props.children}
    </button>
  );
};
export default button;
